import React from "react";
import Inputs from "./Inputs";
import Outputs from "./Outputs";

const Grade = () => {
  return (
    <section className="grade--section">
      <h1 className="title"> Grade Calculator</h1>
      <Inputs />
      <Outputs />
    </section>
  );
};

export default Grade;
